import React from "react";
import { useParams } from "react-router-dom";

const params = useParams();

function EventDetailPage() {
  return (
    <>
      <div>EventDetailPage</div>
      <h1>Event: {params.eventId}</h1>
    </>
  );
}

export default EventDetailPage;
